import Card from '../card/card';

import './cards.css';

function Cards({ allRazas }) {
   const razas = allRazas

   return (
      <div className='cards'>
         {allRazas?.map(razas =>
            <Card razas={razas} />)}
      </div>
   );
}

export default Cards;
